&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;El Tren de los n&uacute;meros LEGO&reg; DUPLO&reg; representa una divertida manera de conocer los n&uacute;meros y aprender a contar. &iexcl;A tu peque&ntilde;o le encantar&aacute; construir y reconstruir este simp&aacute;tico tren mientras aprende a reconocer los n&uacute;meros! Con dos figuras DUPLO de ni&ntilde;os y una figura de un gato para m&aacute;s oportunidades de jugar a interpretar, este set proporciona infinitas oportunidades de divertirse construyendo, conduciendo y aprendiendo. Los ladrillos DUPLO est&aacute;n dise&ntilde;ados para proporcionar seguridad y resultar adecuados en las manos de los m&aacute;s peque&ntilde;os.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Incluye dos figuras LEGO&reg; DUPLO&reg; de ni&ntilde;os; incluye tambi&eacute;n una figura de un gato.&lt;/li&gt;
&lt;li&gt;Cuenta con una locomotora para construir y tres vagones.&lt;/li&gt;
&lt;li&gt;Incluye ladrillos decorados con los n&uacute;meros del 0 al 9.&lt;/li&gt;
&lt;li&gt;Usa los ladrillos decorados para ense&ntilde;ar a tu hijo los n&uacute;meros y a contar.&lt;/li&gt;
&lt;li&gt;Este set fomenta las habilidades de construcci&oacute;n e interpretaci&oacute;n.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para resultar divertidos y proporcionar seguridad en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;Este set proporciona una experiencia de construcci&oacute;n y juego apropiada para ni&ntilde;os de 18 meses a 3 a&ntilde;os.&lt;/li&gt;
&lt;li&gt;Con los vagones enganchados, el tren mide m&aacute;s de 10 cm de altura, 37 cm de longitud y 6 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 3&lt;/li&gt;
&lt;li&gt;Piezas: 23&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

